Yes, here's a simple JavaScript function that switches the order of adjectives in a sentence:

```javascript
function switchAdjectives(sentence) {
  // Split the sentence into an array of words
  const words = sentence.split(" ");

  // Filter out common stop words (optional)
  const stopWords = ["a", "an", "the"];
  const filteredWords = words.filter(word => !stopWords.includes(word));

  // Extract the adjectives from the filtered words
  const adjectives = filteredWords.filter((word, index, self) => {
    return self.indexOf(word) === index && word.match(/[a-z]{3,}$/);
  });

  // Reverse the order of the adjectives
  const reversedAdjectives = adjectives.reverse();

  // Combine the original noun and the reversed adjectives
  const result = [words[0], ...reversedAdjectives, ...filteredWords.slice(adjectives.length)].join(" ");

  return result;
}

// Example usage:
const inputSentence = "Beautiful green trees are in the park.";
const outputSentence = switchAdjectives(inputSentence);
console.log(outputSentence); // Output: "Green beautiful trees are in the park."
```

The `switchAdjectives` function takes a sentence as its argument, splits it into an array of words, filters out common stop words, extracts the adjectives, reverses their order, and combines them with the original noun and the remaining words. The function returns the modified sentence.

