To calculate the percentage of refund in C++, you can follow these steps:

1. Calculate the total amount paid by the consumer: $1000 (purchase price)
2. Calculate the residual value of the product: $200
3. Calculate the agreed-upon refund: $600
4. Calculate the difference between the total amount paid and the residual value: $800 (total amount less residual value)
5. Calculate the percentage of refund as follows:
   - Calculate the ratio of the agreed-upon refund to the total amount less residual value: $600 / $800
   - Multiply the ratio by 100 to get the percentage: approximately 75%

Here's an example of C++ code to calculate the percentage of refund:

```cpp
#include <iostream>
#include <cmath> // Required for roundf()

int main() {
    const double PURCHASE_PRICE = 1000;
    const double RESIDUAL_VALUE = 200;
    const double REFUND_AMOUNT = 600;
    const double TOTAL_AMOUNT_LESS_RESIDUAL_VALUE = PURCHASE_PRICE - RESIDUAL_VALUE;
    const double PERCENTAGE = roundf(REFUND_AMOUNT / TOTAL_AMOUNT_LESS_RESIDUAL_VALUE * 100);

    std::cout << "The percentage of refund is: " << PERCENTAGE << "%\n";

    return 0;
}
