2. Hold and Wait: Philosophers can hold onto a chopstick while waiting for another. For example, if a philosopher has already acquired their left chopstick, they can wait for their right chopstick without releasing the left one.

3. No Preemption: Once a philosopher has acquired a chopstick, they cannot be forced to release it. This ensures that once a philosopher has obtained a chopstick, they get to keep it until they are finished eating.

4. Circular Wait: The last condition leads to circular waiting patterns, where philosophers wait for resources held by other philosophers who, in turn, wait for resources held by yet other philosophers, forming a cycle.

To avoid deadlock, we need to break one of these conditions. Here are some ways to do so:

1. Eliminate Hold and Wait: A solution is to implement a policy called "chopstick policy" or "alternating-policy". In this policy, each philosopher alternates between using their left and right chopsticks. This ensures that no philosopher will hold onto a chopstick for too long, breaking the Hold and Wait condition. Pseudo code for this implementation would look like:

