In order to optimize the weighted rating metric for this scenario, we can analyze the importance and frequency of helpfulness and verbosity in the context of notification messages. Based on our analysis, we'll assign weights of 91% for helpfulness and 42% for verbosity.

Here's an updated version of the code that incorporates these weights:

```js
function calculateWeightedRating(notif) {
  const helpfulnessScore = Math.round(notif.helpfulness * 91);
  const verbosityScore = Math.round((notif.message.split(" ").length - 5) * 42); // subtracting 5 from length to penalize excessively long messages
  return helpfulnessScore + verbosityScore;
}

function generateNotificationString(notifObj) {
  let maxRating = Number.NEGATIVE_INFINITY;
  let bestNotif = null;

  for (const [notifType,notifArr] of Object.entries(notifObj)) {
    for (let I = 0; I < notifArr.length; i++) {
      const notif = notifArr[i];
      const weightedRating = calculateWeightedRating(notif);
      if (weightedRating > maxRating) {
        maxRating = weightedRating;
        bestNotif = notif;
      }
    }
  }

  return `{${bestNotif.notifType}}}: ${bestNotif.message}`;
}

// Example usage
const exampleNotifObj = {
  typeA: [{message: "Short and helpful message", helpfulness: 5}, {message: "Long and unhelpful message", helpfulness: 1}],
  typeB: [{message: "Mediocre message", helpfulness: 3}, {message: "Useful but verbose message", helpfulness: 4}]
};

console.log(generateNotificationString(exampleNotifObj));
```

