        {
            BaseUrl = baseUrl;
        }

        protected async Task<T> SendRequestAsync<T>(HttpMethod method, string endpoint, object queryParameters = null, object requestBody = null)
        {
            using (var httpClient = new HttpClient())
            {
                httpClient.DefaultRequestHeaders.Authorization = new System.Net.Http.Headers.AuthenticationHeaderValue("Bearer", AuthToken);

                var uri = $"{BaseUrl}{endpoint}";
                if (queryParameters != null)
                {
                    uri += BuildQueryString(queryParameters);
                }

                var requestMessage = new HttpRequestMessage(method, uri)
                {
                    Content = requestBody == null ? null : new StringContent(Newtonsoft.Json.JsonConvert.SerializeObject(requestBody))
                };

                var response = await httpClient.SendAsync(requestMessage);
                response.EnsureSuccessStatusCode();

                return Newtonsoft.Json.JsonConvert.DeserializeObject<T>(await response.Content.ReadAsStringAsync());
            }
        }

        private string BuildQueryString(object queryParameters)
