function getNestedOptions(object, keyPath) {
  const keys = keyPath.split('.');
  let currentObj = object;

  for (let I = 0; I < keys.length - 1; i++) {
    if (!currentObj[keys[i]]) {
      // If we encounter a missing key, stop iterating and return an empty array
      return [];
    }
    currentObj = currentObj[keys[i]];
  }

  const lastKey = keys[keys.length - 1];
  const values = Object.values(currentObj);

  // Filter the values based on whether they match the last key
  const matchedValues = values.filter(value => typeof value === 'object' ? getNestedOptions(value, lastKey).length > 0 : value?.toString().includes(keyPath.split('.')[keys.length - 1]))

  return matchedValues;
}
```

This function takes two arguments: `object`, which is the object containing the nested properties, and `keyPath`, which is the path to the desired property. It returns an array containing the values that match the given criteria at the end of the key path.

The function works by splitting the key path into an array of keys, then recursively navigating through the object until it reaches the final key. It keeps track of the current object being inspected in the `currentObj` variable. If any of the intermediate keys is missing, it immediately returns an empty array.

Once the final key has been reached, the function retrieves the associated values and filters them according to the matching criteria. The filtering process checks whether the value is an object or a primitive, and whether it contains the desired substring (in case of primitives) or has any matching nested options (in case of objects).

Note that this function assumes that the nested property can be accessed using a simple string key, without the need for complex dynamic accessors or computed property names. Also, note that it doesn't handle cases where the final key might appear multiple times within the same level of nesting. In such cases, you may want to modify the filtering logic to account for duplicates.

