```csharp
public decimal Price { get; set; }
```

2. Controller: The controller handles user input and communicates with both the model and the view. Whenever a request is made that involves the new attribute, the controller retrieves the updated data from the model using the new property. For instance, if the user requests a list of products with their prices, the controller would call the `GetProducts()` method on the model, which returns a list of products along with their prices:

```csharp
