```javascript
function shuffleArray(arr, randomize) {
  const result = [];

  for (let I = 0; I < arr.length; i++) {
    let position = arr[i].position - 1;

    // Randomly swap position if randomize is true
    if (randomize && Math.random() > 0.5) {
      const swappedIndex = Math.floor(Math.random() * result.length);
      [result[swappedIndex], result[position]] = [result[position], result[swappedIndex]];
    }

    result[position] = arr[i];
  }

  return result;
}

