3. Next, create an instance of `JwtSecurityTokenHandler` and pass it the extracted token:

```csharp
JwtSecurityTokenHandler handler = new JwtSecurityTokenHandler();
```

4. Parse the token using the handler:

```csharp
JwtSecurityToken securityToken = handler.ReadJwtToken(token);
```

5. Extract the username from the token's claims:

```csharp
string username = securityToken.Claims.FirstOrDefault(x => x.Type == ClaimTypes.Name)?.Value;
```

6. Use the retrieved username as needed in your controller method. Here's an example:

```csharp
[HttpGet]
public async Task<IActionResult> Get()
{
    string token = Request.Headers["Authorization"].Replace("Bearer ", string.Empty);
    JwtSecurityTokenHandler handler = new JwtSecurityTokenHandler();
    JwtSecurityToken securityToken = handler.ReadJwtToken(token);
    string username = securityToken.Claims.FirstOrDefault(x => x.Type == ClaimTypes.Name)?.Value;

    // Use the username here...
    return Ok(new { Message = $"Welcome back, {username}!" });
}
```

