```c
#include <stdio.h>
#include <stdlib.h>

int main(int argc, char *argv[]) {
    size_t arg_len = 0;
    char *args = NULL;

    for (int I = 0; I < argc; i++) {
        arg_len += strlen(argv[i]) + 1;
    }

    args = malloc(arg_len);

    size_t pos = 0;
    for (int I = 0; I < argc; i++) {
        strcpy(&args[pos], argv[i]);
