```python
def selection(arr, low, high, k):
    if low == high:
        return arr[low]

    # Find the index of pivot element (last element)
    pivot = high
    I = (low - 1)
    for j in range(low, high):
        # If current element is smaller than or equal to pivot
        if arr[j] <= arr[pivot]:
            # increment index of smaller element
            i = i + 1
            # Swap elements at i and j positions
            arr[i], arr[j] = arr[j], arr[i]

    # Swap pivot with new position found
    arr[i+1], arr[pivot] = arr[pivot], arr[i+1]

    // Recursively call selection() for left and right sub-arrays
    if k > i+1:
        return selection(arr, i+1, high, k)
    elif k < i+1:
        return selection(arr, low, i, k)
    else:
        return arr[k]

