int binarySearch(int arr[], int left, int right, int x) {
    while (left <= right) {
        int mid = left + (right - left) / 2;
        if (arr[mid] == x) {
            return mid;
        }
        if (arr[mid] > x) {
            right = mid - 1;
        } else {
            left = mid + 1;
        }
    }
    return -1;
}

// Example usage:
int myArray[] = {2, 5, 7, 9, 11};
int n = sizeof(myArray) / sizeof(myArray[0]);
int target = 7;
int result = binarySearch(myArray, 0, n - 1, target);
